import React, { useEffect } from "react"
import { makeStyles } from '@material-ui/core/styles'
import Container from '@material-ui/core/Container'
import Box from '@material-ui/core/Box'
import Grid from '@material-ui/core/Grid'
import Icon from '@material-ui/core/Icon';
import Typography from '@material-ui/core/Typography'
import Listings from '../components/Listings'
import FilterBar from '../components/FilterBar'


const useStyles = makeStyles(theme => ({
  root: {
    [theme.breakpoints.up('sm')]: {
      width: "650px",
    },
    width: "100%",
    background: "#F6F9FC",
    display: 'inline-block',
    zIndex:100,
    boxShadow: '1px 4px 6px -1px rgba(0, 0, 0, 0.1), 1px 2px 4px -1px rgba(0, 0, 0, 0.06)',
  }
}));

const LeftBar = props => {
  const classes = useStyles()

  return (
      <Box className={classes.root}>
        <Filters />
        <Listings therapists={props.therapists} selected= {props.selected} setSelected={props.setSelected}  showMidbar={props.showMidbar} setShowMidbar={props.setShowMidbar}/>
      </Box>
  )
}

export default LeftBar
